import React from 'react';
import Header from './Header';
import Footer from "./Footer";
import Note from './Note.jsx';
import notes from "./notes.jsx";

function App() {
    return(
    <div>
      <Header />

        {notes.map(newItem => (
                <note
                    key = {newItem.key}
                    title ={newItem.title}
                    content ={newItem.content}
                />
        ))}

      <Footer />
    </div>
    );
}

export default App;
